import React from "react";
import { table } from "react-bootstrap";
export const TicketTable = () => {
  return (
    <table>
      <thead>
        <tr>
          <th>#</th>
          <th>Sujet</th>
          <th>Status</th>
          <th>Date d'ouverture</th>
        </tr>
      </thead>
    </table>
  );
};
